// NavBar.js

import React from 'react';
import { Link } from 'react-router-dom';

function NavBar() {
  return (
    <nav className="bg-gray-800 p-4">
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/" className="text-white font-bold text-xl">Digitalflake Admin</Link>
        <div>
          <Link to="/register" className="text-gray-300 mx-4">LogOut</Link>
          <Link to="/forgot-password" className="text-gray-300 mx-4">Forgot Password</Link>
        </div>
      </div>
    </nav>
  );
}

export default NavBar;
